import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";

function App() {
  notes.map((note) => {
    return note.title;
  });

  console.log(notes);

  return (
    <div>
      <Header />
      <Note />
      <Footer />
    </div>
  );
}

export default App;
